INSERT INTO `dod_dynamic_pages` (`id`, `page_name`, `page_slug`, `page_title`, `page_desc`, `meta_keyword`, `meta_title`, `meta_desc`, `page_status`, `created_at`, `updated_at`) VALUES
(12, 'Our Mission', 'about-us', 'Our Mission', '<p style=\"text-align: center;\"><strong>- OUR MISS</strong><strong>ON -</strong></p>\r\n<p style=\"text-align: center;\">To deliver the highest quality healthcare to every Australian - regardless of time, location or language barriers.</p>\r\n<p style=\"text-align: center;\"><strong>- THE BEGINNING -</strong><strong><br /></strong></p>\r\n<p style=\"text-align: center;\">doctoroo was born with the vision of being able to access doctors and medication in a readily available and more convenient way. Christian Nehme (a medical scientist and former hospital research assistant) believed that what doctoroo is today, would touch the lives of many individuals and families across the nation - having worked directly with some of these families during his time as a research assistant.</p>\r\n<p style=\"text-align: center;\">&nbsp;<strong>- WHY WE&rsquo;RE HERE -</strong><strong><br /></strong></p>\r\n<p style=\"text-align: center;\">What started off as a simple vision has evolved into a patient, pharmacy and doctor integrated platform, that delivers both telemedicine and medication management for patients across the nation.</p>\r\n<p style=\"text-align: center;\">At doctoroo, what brings the whole team together is a united goal of solving the biggest uncertainty in Australian healthcare &ndash; <strong>what does the future hold? </strong>We weren&rsquo;t going to wait around and hope for the best, instead &ndash; we paved the future of healthcare for all of us.</p>', 'Our Mission', 'Our Mission | Doctoroo', 'Doctoroo provides pharmacy and doctor integrated solutions to deliver both telehealth and medication management for patients across the world.', 'Active', '2017-02-22 20:12:41', '2017-12-06 06:29:38'),
(13, 'Team', 'team', 'Team', '<p>The team may also include doctors from other areas of medicine. For example, a dermatologist specializes in skin problems and may help treat skin cancer. Learn more about&nbsp;<a href=\"http://www.cancer.net/node/24957\">the oncology team</a>.</p>\r\n<p>If a person&rsquo;s cancer diagnosis is complex, the patient&rsquo;s oncologist may ask a tumor board to review the case. A tumor board consists of medical experts from all relevant areas who help decide the best course of treatment.</p>', 'Health team', 'Health Team for Quick Online Doctor Support', 'At doctoroo, professionals motto is to solve the biggest uncertainity that causing in Australian healthcare. ', 'Active', '2017-02-22 21:52:01', '2017-07-24 10:53:15'),
(14, 'Careers', 'careers', 'Careers', '<p>If you&rsquo;re passionate about doing what&rsquo;s right for patients and physicians, we&rsquo;re the right organization for you. We&rsquo;re looking for team players who are driven by the pursuit of excellence and committed to making a difference in health care.</p>\r\n<p>We provide over 40&nbsp;million global members with access to the best medical minds in the world. Drawing on a network of over 53,000 Best Doctors, we review medical cases to ensure our members have the right diagnoses and treatment plans.</p>\r\n<p>Our culture is dynamic and creative, with a focus on commitment, quality, and collaboration. If you&rsquo;re interested in a career where you can improve health care around the world, we invite you to view our current openings and apply to Best Doctors today.</p>', 'Careers', 'Careers at Doctoroo', 'Careers', 'Active', '2017-02-22 21:53:55', '2017-07-12 09:06:22'),
(15, ' Press ', 'press', ' Press ', '<p>&nbsp;Press&nbsp;</p>', ' Press ', ' Press ', ' Press ', 'Active', '2017-02-22 21:54:37', '2017-02-23 12:48:31'),
(16, ' Privacy Policy', 'privacy-policy', ' Privacy Policy', '<p><span>We understand that medical information about you and your health is personal.</span></p>\r\n<p><span>The physicians and staff of The Doctors Clinic are committed to protecting medical information about you.</span></p>\r\n<p><span>This notice applies to the information and records we have about your health, health status, and the health care and service you receive at The Doctors Clinic.</span></p>\r\n<p><span>Your health information may include information created and received by The Doctors Clinic, may be in the form of written or electronic records or spoken words, and may include information about your health history, health status, symptoms, examinations, test results, diagnoses, treatments, procedures, prescriptions, related billing activity and similar types of health-related information.</span></p>', ' Privacy Policy', 'Privacy Policy of Doctoroo', ' Privacy Policy', 'Active', '2017-02-22 21:55:03', '2017-07-12 09:13:59'),
(21, 'Companies - and - Organisations', 'companies-and-organisations', 'Companies  & Organisations', '<p>Coming soon</p>', 'Companies  & Organisations', 'Companies & Organisations | Doctoroo', 'Companies  & Organisations', 'Active', '2017-02-23 12:14:16', '2017-09-06 01:38:33'),
(22, 'Terms-and-Conditions', 'terms-and-condition', 'Terms & Conditions', '<p><strong>Terms and Conditions of the doctoroo &lsquo;Refer-a-friend&rsquo; promotion</strong></p>\r\n<p>&lsquo;doctoroo&rsquo; refers to DOCTOROO AUSTRALIA PTY. LTD. (ABN: 15 616 602 629) at Level 13, 50 Carrington Street, Sydney NSW 2000.</p>\r\n<p><strong>Commencement and Duration</strong></p>\r\n<p>The Refer-a-friend Promotion (&lsquo;Promotion&rsquo;) is available to new doctoroo customers, which, during the period from 19 May 2017 to 15 July 2017 (&lsquo;Promotion Period&rsquo;) meet the Eligibility criteria and comply with these Terms and Conditions.</p>\r\n<p>This is a prelaunch promotion, where doctoroo&rsquo;s services are not yet functioning, as such, any credits issued from this promotion can only be applied if and when doctoroo services are made live and available for use. The customer will be notified of commencement and launch via the customer registered email address.</p>\r\n<p>Doctoroo reserves the right to change, suspend or discontinue all or any part of this Promotion at its discretion, and any decision on the Promotion is at the sole discretion of doctoroo. Should doctoroo not launch their services as planned, any issued credits will not be able to be redeemed, for cash or any other form of gifts and will become valueless.</p>\r\n<p><strong>Eligibility Criteria &nbsp;</strong></p>\r\n<p>To be eligible for this Promotion, new doctoroo customers must:</p>\r\n<ol>\r\n<li style=\"padding-left: 30px;\">Sign up via the website (<a href=\"../../../\">https://www.doctoroo.com.au</a>);</li>\r\n<li style=\"padding-left: 30px;\">Share their unique code or link with persons (&lsquo;referred friend&rsquo;) who are:\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li style=\"padding-left: 30px;\">A new customer and do not have an existing account with doctoroo</li>\r\n<li style=\"padding-left: 30px;\">living in Australia, and;</li>\r\n<li style=\"padding-left: 30px;\">are aged over 18 and can legally sign up to doctoroo</li>\r\n</ol>\r\n</li>\r\n<li style=\"padding-left: 30px;\">Have at least one referred friend successfully sign up to doctoroo using the referral link of their friend or by entering their friend&rsquo;s unique code upon signing up.</li>\r\n</ol>\r\n<p><strong>Promotion Benefits</strong></p>\r\n<p>The customer (referrer) will receive $10 doctoroo credit to use during their first doctor consultation once doctoroo services are live and the customer has been informed that the credit can be applied (via email). The credit remains valid and available for use for a period of six (6) months after the announcement of the launch date by doctoroo.</p>\r\n<p><strong>Terms and Conditions</strong></p>\r\n<ul>\r\n<li>doctoroo reserves the right, at any time, to verify the validity of referrals and sign ups (including a referrer&rsquo;s or referral friend&rsquo;s identity, age and place of residence) and to disqualify any referrer or applicant who submits a claim or entry that is not in accordance with these terms and conditions or who tampers with the promotion or any online process.</li>\r\n<li>Upon completion of this Promotion, doctoroo reserves the right to use the customer contact information to communicate to the customer subsequent promotions or offers made by doctoroo.</li>\r\n<li>Failure by doctoroo to enforce any of its rights at any stage does not constitute a waiver of those rights.</li>\r\n<li>There is a limit of one $10 credit per customer (even if multiple referred friends sign up).</li>\r\n<li>The doctoroo credit is not exchangeable for cash, credit or any other gift.</li>\r\n<li>No customers can claim a promotion credit after sign up has occurred.</li>\r\n<li>All promotions are subject to doctoroo&rsquo;s general Terms and Conditions.</li>\r\n<li>doctoroo reserves the right to amend or discontinue this promotion at any time and without any prior notice.</li>\r\n<li>doctoroo (including its directors, officers, employees and agents) excludes all liability (except for liability that cannot be excluded by Australian and statutory law) arising from;\r\n<ul style=\"list-style-type: circle;\">\r\n<li>Representations, conditions and warranties implied by custom, the general law or statute; and</li>\r\n<li>any negligence, personal injury and loss or damage whether direct, indirect, special or consequential (including economic loss, loss of revenue, loss of opportunity, loss of goodwill), arising in any way associated with this Promotion, including, but not limited to:</li>\r\n<li>any entry or referral that is late, lost, altered, damaged or misdirected (whether or not after their receipt by doctoroo) due to any reason beyond the reasonable control of doctoroo; and</li>\r\n<li>any variation in the promotion value to that stated in these terms and conditions.</li>\r\n</ul>\r\n</li>\r\n</ul>', 'Terms & Conditions', 'Terms & Condition | Doctoroo', 'Terms and Condition of Doctoroo Australia Ptv. Ltd.', 'Active', '2017-02-23 12:29:00', '2017-07-12 09:03:32'),
(23, 'Doctor FAQ\'s', 'private-health-funds', 'Doctor FAQ\'s', '<p><span style=\"font-weight: 400;\">Getting started is simple:</span></p>\r\n<ol>\r\n<li><span style=\"font-weight: 400;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Complete your registration</span></li>\r\n<li><span style=\"font-weight: 400;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Upload the required documentation (see below)</span></li>\r\n<li><span style=\"font-weight: 400;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Begin accepting patients once you&rsquo;ve been approved by the doctoroo team</span></li>\r\n</ol>\r\n<p><b></b></p>\r\n<p><b>What is the purpose of doctoroo?</b></p>\r\n<p><span style=\"font-weight: 400;\">Our official motto is simple - </span><i><span style=\"font-weight: 400;\">Taking care of you,</span></i><span style=\"font-weight: 400;\"> whether it be patients, doctors or pharmacies. How we do that has been our main focus since the beginning of 2016. Unlike other restricted telemedicine platforms that only allow a few GP&rsquo;s to see patients from across the country - this would eventually destabilise doctor-patient relationships and seriously damage the health industry as we know it today. To combat this, doctoroo empowers every doctor across Australia to be able to see their own patients online and provide them with the care they would normally receive in person. In doing so, our platform works complementary to and in unison with existing, traditional patient care.</span></p>\r\n<p><b></b></p>\r\n<p><b>What information is required to complete my registration?</b></p>\r\n<p><span style=\"font-weight: 400;\">In order to comply with regulations of telehealth in Australia, we&rsquo;re required to verify your identity, medical registration and insurance documentation. We&rsquo;ll require the following:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Information about you (name, gender, DOB, citizenship, email, phone, address, photo &amp; 30 second video)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Medical practice details (clinic name, address, contact details)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Qualifications (medical qualification, country obtained, years&rsquo; experience, consulting languages etc)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Bank account details</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Documentation</span></li>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Photo/scan of Drivers licence or Australian passport</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Photo/scan of Medical registration certificate &amp; number</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Prescriber number</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">AHPRA registration number</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">ABN</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pohoto/scan of Insurance policy cover - Prfessional Indemnity (+ Telehealth) &amp; Cyber Liability Insurance</span></li>\r\n</ul>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">All the above documents that you upload will need to be certified by a referee as a true copy of the original prior to uploading. For more details about certifying documents, </span><a href=\"https://www.ahpra.gov.au/Registration/Registration-Process/Certifying-Documents.aspx\"><span style=\"font-weight: 400;\">please visit here</span></a><span style=\"font-weight: 400;\">.</span></p>\r\n<p><b></b></p>\r\n<p><b>Are there any special requirements for becoming a member?</b></p>\r\n<p><span style=\"font-weight: 400;\">Looking after the health of Australian patients, and proactively managing health issues is paramount. In order to do so, whilst complying with regulations of telehealth in Australia, we have a stringent assessment and selection process and we require our doctor applicants to demonstrate the following:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cuency in other languages are a bonus)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Commitment to best practice, ethical behaviour and conducturrently practicing medicine in Australia</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">A minimum of two years of GP experience (preferred)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Excellent computer literacy and reliable availability of a computer or tablet and secure internet connection</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Excellent verbal and written communication skills in English (fl</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Keen interest in telemedicine</span></li>\r\n</ul>\r\n<p><b></b></p>\r\n<p><b>How can I access doctoroo?</b></p>\r\n<p><span style=\"font-weight: 400;\">You can access doctoroo using almost any device (phones, tablets or computers) by simply visiting our website (</span><a href=\"https://doctoroo.com.au/doctor\"><span style=\"font-weight: 400;\">https://doctoroo.com.au/doctor</span></a><span style=\"font-weight: 400;\">) and logging in as a doctor.</span></p>\r\n<p><span style=\"font-weight: 400;\">We&rsquo;re also working on delivering mobile apps for our users in the near future.</span></p>\r\n<p><b></b></p>\r\n<p><b>What is my legal relationship with doctoroo?</b></p>\r\n<p><span style=\"font-weight: 400;\">Being a technology platform which facilitates your consultations with your patients, our legal relationship meets the Australian Taxation Office\'s definition of a contractor, whereby:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You&rsquo;ll use your own tools and equipment to practice medicine online and access our platform</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You&rsquo;ll have a high level of control in how you provide your services</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You&rsquo;ll decide what hours and where to work</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">With your own Liability Insurance, you&rsquo;re responsible and liable for all the services that you provide</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You&rsquo;ll have an ABN and be responsible for your superannuation, Tax and GST</span></li>\r\n</ul>\r\n<p><b></b></p>\r\n<p><b>What are my responsibilities on the platform?</b></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Setting availability times in your calendar as required</span></li>\r\n</ul>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Respond to patient consultation requests in a timely manner</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Conduct online consultation with patients</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Conduct these consultations in a private and quiet room and ensure no one can listen to or see the consultation</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Have a secure and reliable internet, computer or tablet, camera and microphone (usually built into device), although we recommend a headset for audio</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If you see fit, provide a medical certificate, referral, prescription or other required documents or services to the patient</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Ensure timeframes and schedules are adhered to</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comply with privacy and confidentiality principles to all work practices including doctoroo policies and procedures</span></li>\r\n</ul>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comply with all AMA regulations and relevant laws</span></li>\r\n</ul>\r\n<p><b></b></p>\r\n<p><b>Can I see my own patients?</b></p>\r\n<p><span style=\"font-weight: 400;\">Absolutely - it is one of the main original features of the website - being able to provide continuity of care for your patients, in order to provide them convenience and to also avoid them seeing unrelated doctors online. </span></p>\r\n<p><span style=\"font-weight: 400;\">You may also utilise our marketing efforts to gain external patients from across the country. You also have the option of selecting whichever patients you would like to see.</span></p>\r\n<p></p>\r\n<p><b>How long do consultations last?</b></p>\r\n<p><span style=\"font-weight: 400;\">The maximum duration for a consultation is currently 15 minutes. You or the patient can end the call at anytime. </span></p>\r\n<p></p>\r\n<p><b>Are the consultations covered by Medicare?</b></p>\r\n<p><span style=\"font-weight: 400;\">Currently, all telemedicine consultations on our platform are privately billed to the patient. These may become bulk-billed in the future with updates from the government, which we are actively participated in lobbying. </span></p>\r\n<p></p>\r\n<p><b>What are my earnings per consultation?</b></p>\r\n<p><span style=\"font-weight: 400;\">We highly value our doctors, their impact on society and their valuable time. We offer doctors a guaranteed earning for every minute spent during a consultation, reflecting our value on every moment of your time. </span></p>\r\n<p><span style=\"font-weight: 400;\">Your earnings depend on the membership option you select:</span></p>\r\n<ul>\r\n<li><span style=\"font-weight: 400;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Standard &ndash; your minutely earnings are as set out below</span></li>\r\n<li><span style=\"font-weight: 400;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Premium &ndash; you may set your own rate per consultation </span></li>\r\n</ul>\r\n<p></p>\r\n<p><b>Standard membership earnings</b></p>\r\n<table style=\"width: 475.983px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 62px; text-align: center;\">\r\n<p><b>Time </b></p>\r\n<p><b>(min)</b></p>\r\n</td>\r\n<td style=\"width: 91px; text-align: center;\">\r\n<p><b>Day </b></p>\r\n<p><b>(8am-8pm)</b></p>\r\n</td>\r\n<td style=\"width: 106px; text-align: center;\">\r\n<p><b>Day Hourly rate (pro-rata)</b></p>\r\n</td>\r\n<td style=\"width: 99px; text-align: center;\">\r\n<p><b>Night</b></p>\r\n<p><b> (8pm-8am)</b></p>\r\n</td>\r\n<td style=\"width: 110.983px; text-align: center;\">\r\n<p><b>Night Hourly rate (pro-rata)</b></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 62px;\">\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n</td>\r\n<td style=\"width: 91px;\">\r\n<p><span style=\"font-weight: 400;\">0</span></p>\r\n</td>\r\n<td style=\"width: 106px;\">\r\n<p><span style=\"font-weight: 400;\">0</span></p>\r\n</td>\r\n<td style=\"width: 99px;\">\r\n<p><span style=\"font-weight: 400;\">0</span></p>\r\n</td>\r\n<td style=\"width: 110.983px;\">\r\n<p><span style=\"font-weight: 400;\">0</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 62px;\">\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n</td>\r\n<td style=\"width: 91px;\">\r\n<p><span style=\"font-weight: 400;\">10</span></p>\r\n</td>\r\n<td style=\"width: 106px;\">\r\n<p><span style=\"font-weight: 400;\">300</span></p>\r\n</td>\r\n<td style=\"width: 99px;\">\r\n<p><span style=\"font-weight: 400;\">18</span></p>\r\n</td>\r\n<td style=\"width: 110.983px;\">\r\n<p><span style=\"font-weight: 400;\">540</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 62px;\">\r\n<p><spa