</td>\r\n<td style=\"width: 91px;\">\r\n<p><span style=\"font-weight: 400;\">27</span></p>\r\n</td>\r\n<td style=\"width: 106px;\">\r\n<p><span style=\"font-weight: 400;\">147</span></p>\r\n</td>\r\n<td style=\"width: 99px;\">\r\n<p><span style=\"font-weight: 400;\">35</span></p>\r\n</td>\r\n<td style=\"width: 110.983px;\">\r\n<p><span style=\"font-weight: 400;\">191</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 62px;\">\r\n<p><span style=\"font-weight: 400;\">12</span></p>\r\n</td>\r\n<td style=\"width: 91px;\">\r\n<p><span style=\"font-weight: 400;\">28</span></p>\r\n</td>\r\n<td style=\"width: 106px;\">\r\n<p><span style=\"font-weight: 400;\">140</span></p>\r\n</td>\r\n<td style=\"width: 99px;\">\r\n<p><span style=\"font-weight: 400;\">36</span></p>\r\n</td>\r\n<td style=\"width: 110.983px;\">\r\n<p><span style=\"font-weight: 400;\">180</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 62px;\">\r\n<p><span style=\"font-weight: 400;\">13</span></p>\r\n</td>\r\n<td style=\"width: 91px;\">\r\n<p><span style=\"font-weight: 400;\">29</span></p>\r\n</td>\r\n<td style=\"width: 106px;\">\r\n<p><span style=\"font-weight: 400;\">134</span></p>\r\n</td>\r\n<td style=\"width: 99px;\">\r\n<p><span style=\"font-weight: 400;\">37</span></p>\r\n</td>\r\n<td style=\"width: 110.983px;\">\r\n<p><span style=\"font-weight: 400;\">171</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 62px;\">\r\n<p><span style=\"font-weight: 400;\">14</span></p>\r\n</td>\r\n<td style=\"width: 91px;\">\r\n<p><span style=\"font-weight: 400;\">30</span></p>\r\n</td>\r\n<td style=\"width: 106px;\">\r\n<p><span style=\"font-weight: 400;\">129</span></p>\r\n</td>\r\n<td style=\"width: 99px;\">\r\n<p><span style=\"font-weight: 400;\">38</span></p>\r\n</td>\r\n<td style=\"width: 110.983px;\">\r\n<p><span style=\"font-weight: 400;\">163</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 62px;\">\r\n<p><span style=\"font-weight: 400;\">15</span></p>\r\n</td>\r\n<td style=\"width: 91px;\">\r\n<p><span style=\"font-weight: 400;\">31</span></p>\r\n</td>\r\n<td style=\"width: 106px;\">\r\n<p><span style=\"font-weight: 400;\">124</span></p>\r\n</td>\r\n<td style=\"width: 99px;\">\r\n<p><span style=\"font-weight: 400;\">39</span></p>\r\n</td>\r\n<td style=\"width: 110.983px;\">\r\n<p><span style=\"font-weight: 400;\">156</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"text-decoration: underline;\"><span style=\"font-weight: 400;\">Comparison to traditional in-person consultations</span></span></p>\r\n<p><span style=\"font-weight: 400;\">Data from Bettering the Evaluation and Care of Health (BEACH 2008&ndash;2009) show average consultation times in Australian general practice are 14.6 minutes. This equates to seeing an average of approximately 4-5 patients per hour</span></p>\r\n<p><span style=\"font-weight: 400;\">Average telemedicine consultations are approximately 7 minutes, and with the above earnings table, this equates to an hourly rate of $197 - $266 (pro-rata) depending on time of consultation.</span></p>\r\n<p></p>\r\n<p><b>How do I receive my earnings?</b></p>\r\n<p><span style=\"font-weight: 400;\">Your consultations on doctoroo are privately billed to your patients. Our highly efficient payment process means you&rsquo;ll have instant settlements of your earnings directly into your bank account. These are managed through our secure payment gateway which we&rsquo;ll help you set up an account with in minutes. You&rsquo;ll also be able to view all your invoices regarding your consultations within your account, and set how often you&rsquo;d like to receive bank transfers.</span></p>\r\n<p></p>\r\n<p><b>What are the membership fees?</b></p>\r\n<p><span style=\"font-weight: 400;\">Our standard membership provides you with our entire platform, absolutely free for you to use. You&rsquo;ll enjoy the following features:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Select your own availability</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Work anywhere in australia</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">See your existing patients online</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">See new patients Australia-wide</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Use the entire platform with no limits</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Unlimited consultations</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% free - no monthly fee</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Your earnings will be as per the standard pricing table above</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">If you wish to set your own custom consultation day &amp; night rates, our flexible premium membership allows you to do so, at a nominal membership fee of $59/month. </span></p>\r\n<p><b></b></p>\r\n<p><b>Are there long term commitments?</b></p>\r\n<p><span style=\"font-weight: 400;\">Part of our approach to telemedicine is giving our doctors freedom in how they practice. We understand circumstances change and you may decide to cancel your membership. There are no cancellation fees for monthly memberships - you&rsquo;re free to cancel your account anytime as long as there are no pending consultations. For longer term memberships, there are no cancellation fees either, but our no refund policy applies. </span></p>\r\n<p></p>\r\n<p><b>How much does it cost a patient to see a doctor?</b></p>\r\n<p><span style=\"font-weight: 400;\">The cost to the patient depends on the doctor\'s rates. According to the 2 pricing memberships available for doctors, patients</span></p>\r\n<p><span style=\"text-decoration: underline;\">Standard Pricing</span></p>\r\n<p><span style=\"font-weight: 400;\">In order to keep doctoroo an affordable option for Australian patients, allowing more patients to use the platform, we&rsquo;ve offered a standard pricing model as below:</span></p>\r\n<table style=\"width: 376.467px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 133px; text-align: center;\">\r\n<p><b>Consultation Time (minutes)</b></p>\r\n</td>\r\n<td style=\"width: 120px; text-align: center;\">\r\n<p><b>Day Cost</b></p>\r\n</td>\r\n<td style=\"width: 118.467px; text-align: center;\">\r\n<p><b>Night Cost</b></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 133px;\">\r\n<p><span style=\"font-weight: 400;\">0 - 4</span></p>\r\n</td>\r\n<td style=\"width: 120px;\">\r\n<p><span style=\"font-weight: 400;\">$29</span></p>\r\n</td>\r\n<td style=\"width: 118.467px;\">\r\n<p><span style=\"font-weight: 400;\">$39</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 133px;\">\r\n<p><span style=\"font-weight: 400;\">4 &ndash; 8</span></p>\r\n</td>\r\n<td style=\"width: 120px;\">\r\n<p><span style=\"font-weight: 400;\">$39</span></p>\r\n</td>\r\n<td style=\"width: 118.467px;\">\r\n<p><span style=\"font-weight: 400;\">$49</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 133px;\">\r\n<p><span style=\"font-weight: 400;\">8 - 15</span></p>\r\n</td>\r\n<td style=\"width: 120px;\">\r\n<p><span style=\"font-weight: 400;\">$49</span></p>\r\n</td>\r\n<td style=\"width: 118.467px;\">\r\n<p><span style=\"font-weight: 400;\">$59</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-weight: 400;\">This is priced in such a way as to be an affordable option for patients to get in touch with a doctor. The 4-minute session model was architectured to ensure that patients only pay for the time the doctor has given them i.e. avoiding paying $49 for a full 15-minute consultation that may only last 4-7 minutes is highly unfair and part of the reason why Medicare is continually being seen as unsustainable and the previously long-held Medicare rebate freeze for doctors and the future potential of a Medicare co-payment for patients.</span></p>\r\n<p><span style=\"text-decoration: underline;\">Premium Pricing</span></p>\r\n<p>The patient will be charged the doctor\'s custom rate plus the doctoroo fee (approx. $15).</p>\r\n<p><b></b></p>\r\n<p><b>How does doctoroo attract patients?</b></p>\r\n<p><span style=\"font-weight: 400;\">We&rsquo;re passionate about bringing our platform to every Australian so they have access to healthcare at their fingertips. We do this via:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Online marketing</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Social media advertising</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Print and traditional marketing</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Paid advertising</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pharmacy &amp; industry partners</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Corporate referrals</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Public Relations</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Referral incentives</span></li>\r\n</ul>\r\n<p><b></b></p>\r\n<p><b>Where can I practice?</b></p>\r\n<p><span style=\"font-weight: 400;\">You are able to access the platform, accept patients and conduct consultations anywhere in australia along with the requirements mentioned earlier. </span></p>\r\n<p><b></b></p>\r\n<p><b>Are there minimal time commitments?</b></p>\r\n<p><span style=\"font-weight: 400;\">Not at all - you have the freedom of seeing patients anytime, 24/7, with absolute flexibility to the number of hours you work, and the day and time that you work.</span></p>\r\n<p></p>\r\n<p><b>How do i accept patients?</b></p>\r\n<p><span style=\"font-weight: 400;\">By simply logging in and selecting &ldquo;available now&rdquo; &ndash; you will instantly be shown to patients who are currently searching for a doctor across Australia.</span></p>\r\n<p><span style=\"font-weight: 400;\">If you know future days you&rsquo;ll be available to accept patients, you can simply add your availability day/s and time blocks (e.g. Monday 2pm - 7pm) in your calendar and you&rsquo;ll be shown to patients when they search for a doctor during those times.</span></p>\r\n<p><b></b></p>\r\n<p><b>Can I, or the patient, record a consultation?</b></p>\r\n<p><span style=\"font-weight: 400;\">We have a strict no-recording policy of consultations. However, in some rare cases that a consultation may need to be recorded and both parties agree to this, both parties (doctor and patient) will need to send a written confirmation to each other in order to seek permission to record the consultation.</span></p>\r\n<p></p>\r\n<p><b>Does doctoroo integrate with my medical software?</b></p>\r\n<p><span style=\"font-weight: 400;\">That&rsquo;s one of the main features we&rsquo;re currently working on implementing &ndash; soon enough, you&rsquo;ll be able to sync your patient&rsquo;s data from your medical software directly to the doctoroo platform. Currently, the patient can enter/update all their medical records, and you&rsquo;ll be able to securely upload a scanned prescription, medical certificate or any other document for the patient to access. We also have a very handy medical certificate generator that allows you to create and send a medical certificate in less than 10 seconds to the patient.</span></p>\r\n<p><b></b></p>\r\n<p><b>How does doctoroo uphold Australian Medical regulations?</b></p>\r\n<p><span style=\"font-weight: 400;\">Our mission is about providing a long-term solution for practitioners and their patients and we understand that to do this, we must meet all regulations and also be a voice for the wider telehealth community when actively participating in discussions around the topic of best telemedicine adoption practices. </span></p>\r\n<p><span style=\"font-weight: 400;\">As distinguishable from some other telemedicine providers, we do not support the questionable service of providing prescriptions to patients by simply completing questionnaire, all without the patient actually seeing the doctor at all. This is a highly controversial practice we are heavily opposed to and that has come into question from the AMA. Our platform addresses this effectively by allowing the patient to see their own GP online as they otherwise would in person, and if their GP has not yet registered, they are able to invite them, whilst seeing an available GP until then. </span></p>\r\n<p><span style=\"font-weight: 400;\">Our platform meets all regulations as set out by AHPRA and the AMA and general privacy laws in Australia. </span></p>\r\n<p></p>\r\n<p><b>What is the efficacy of telehealth?</b></p>\r\n<p><span style=\"font-weight: 400;\">The expansion of telehealth approaches over the past decade has resulted in greater accessibility to health services and improved health outcomes, especially for people living in rural and remote locations. This has been the focus of numerous studies which have highlighted the benefits of telehealth approaches for the broader health system, some of which are accessible via:</span></p>\r\n<p><a href=\"../../../blogs/efficacy-of-telehealth-in-australia\"><span style=\"font-weight: 400;\">https://www.doctoroo.com.au/blogs/efficacy-of-telehealth-in-australia</span></a></p>\r\n<p></p>\r\n<p><b>How secure is the platform?</b></p>\r\n<p><span style=\"font-weight: 400;\">Although no one can guarantee the security of the internet, we&rsquo;ve designed our entire platform with security as one of our top priorities. In order to achieve a secure platform, we&rsquo;ve taken serious approaches in terms of not only meeting industry standards, but exceeding these standards in many instances. Ways in which we ensure security of your, and patients information include:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">All data is hosted on a very secure Australian-based server which is subject to Australian privacy laws</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">256 Bit encrypted EV SSL certificate (offers encryption of data transferred via the platform)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">End-to-end encryption of video consultations from your device directly to patient&rsquo;s device &ndash; no one can listen in or see your consultation beside you and the patient at the other end</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We have a strict no-recording policy for all consultations (this policy applies to doctors and patients)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Our internal governance is very strict with confidentiality agreements with all doctoroo employees, directors and partners. Only selected people with clearance are able to access the platform\'s backend.</span></li>\r\n</ul>\r\n<p><b></b></p>\r\n<p><b>Does doctoroo provide training to use the platform?</b></p>\r\n<p><span style=\"font-weight: 400;\">Our very user-friendly and simple to use page layouts mean that learning to use the platform is very straightforward. We also have a very flexible training program that covers any questions you may have about the usability of the platform that is conducted on the phone at your convenience. We&rsquo;ll even have a few sample demonstrations together before you go live on the platform. </span></p>\r\n<p><b></b></p>\r\n<p><b>When can I start using the platform?</b></p>\r\n<p><span style=\"font-weight: 400;\">Development of the platform is almost complete and launch will be within the coming months. We will be conducting a trial of the platform between a select number of GP&rsquo;s and our pool of private patients. If you are interested in joining our beta-testing program, please express your interest via email to </span><a href=\"mailto:wecare@doctoroo.com.au\"><span style=\"font-weight: 400;\">wecare@doctoroo.com.au</span></a></p>', 'Doctor FAQ\'s', 'Doctor FAQ\'s', 'Doctor FAQ\'s', 'Active', '2017-02-23 13:44:04', '2017-07-25 01:13:14'),
(24, 'Faqs', 'faqs', 'Faqs', '<p>Faqs</p>', 'Frequently Asked Questions', 'Frequently Asked Questions  | dr oo', 'Common questions and answers about our online medical advice services, contact to doctoroo.com.au', 'Active', '2017-02-26 11:58:33', '2017-05-25 08:23:40'),
(25, 'pricing', 'pricing', 'pricing', '<p>pricing</p>', 'pricing plans', 'Pricing Plans - Australia Most Affordable Platforms', 'Doctoroo the Australia\'s most affordable online doctor consulation platforms helps you to save time and money. Visit today to know the pricing plans. ', 'Active', '2017-03-19 14:05:33', '2017-05-25 08:09:14'),
(26, 'Terms-and-Condition-Refer -a- friend', 'terms-and-condition-refer-a-friend', 'Terms & Conditions for \'Refer a friend\'', '<p>\'doctoroo\' refers to DOCTOROO AUSTRALIA PTY. LTD. (ABN: 15 616 602 629) at Level 13, 50 Carrington Street, Sydney NSW 2000.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Commencement and Duration</strong></p>\r\n<p>&nbsp;</p>\r\n<p>The Refer-a-friend Promotion (\'Promotion\') is available to new doctoroo customers, which, during the period from 19 May 2017 to 15 July 2017 (\'Promotion Period\') meet the Eligibility criteria and comply with these Terms and Conditions.</p>\r\n<p>This is a prelaunch promotion, where doctoroo\'s services are not yet functioning, as such, any credits issued from this promotion can only be applied if and when doctoroo services are made live and available for use. The customer will be notified of commencement and launch via the customer registered email address.</p>\r\n<p>Doctoroo reserves the right to change, suspend or discontinue all or any part of this Promotion at its discretion, and any decision on the Promotion is at the sole discretion of doctoroo. Should doctoroo not launch their services as planned, any issued credits will not be able to be redeemed, for cash or any other form of gifts and will become valueless.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Eligibility Criteria</strong></p>\r\n<p>&nbsp;</p>\r\n<p>To be eligible for this Promotion, new doctoroo customers must:</p>\r\n<p>a. Sign up via the website (https://www.doctoroo.com.au);</p>\r\n<p>b. Share their unique code or link with persons (\'referred friend\') who are:</p>\r\n<p>i. A new customer and do not have an existing account with doctoroo</p>\r\n<p>ii. living in Australia, and;</p>\r\n<p>iii. are aged over 18 and can legally sign up to doctoroo</p>\r\n<p>c. Have at least one referred friend successfully sign up to doctoroo using the referral link of their friend or by entering their friend\'s unique code upon signing up.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Promotion Benefits</strong></p>\r\n<p>&nbsp;</p>\r\n<p>The customer (referrer) will receive $10 doctoroo credit to use during their first doctor consultation once doctoroo services are live and the customer has been informed that the credit can be applied (via email). The credit remains valid and available for use for a period of six (6) months after the announcement of the launch date by doctoroo.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Terms and Conditions</strong></p>\r\n<p>&nbsp;</p>\r\n<p>1. doctoroo reserves the right, at any time, to verify the validity of referrals and sign ups (including a referrer\'s or referral friend\'s identity, age and place of residence) and to disqualify any referrer or applicant who submits a claim or entry that is not in accordance with these terms and conditions or who tampers with the promotion or any online process.</p>\r\n<p>2. Upon completion of this Promotion, doctoroo reserves the right to use the customer contact information to communicate to the customer subsequent promotions or offers made by doctoroo.</p>\r\n<p>3. Failure by doctoroo to enforce any of its rights at any stage does not constitute a waiver of those rights.</p>\r\n<p>4. There is a limit of one $10 credit per customer (even if multiple referred friends sign up).</p>\r\n<p>5. The doctoroo credit is not exchangeable for cash, credit or any other gift.</p>\r\n<p>6. No customers can claim a promotion credit after sign up has occurred.</p>\r\n<p>7. All promotions are subject to doctoroo\'s general Terms and Conditions.</p>\r\n<p>8. doctoroo reserves the right to amend or discontinue this promotion at any time and without any prior notice.</p>\r\n<p>9. doctoroo (including its directors, officers, employees and agents) excludes all liability (except for liability that cannot be excluded by Australian and statutory law) arising from;</p>\r\n<p>a. Representations, conditions and warranties implied by custom, the general law or statute; and</p>\r\n<p>b. any negligence, personal injury and loss or damage whether direct, indirect, special or consequential (including economic loss, loss of revenue, loss of opportunity, loss of goodwill), arising in any way associated with this Promotion, including, but not limited to:</p>\r\n<p>i. any entry or referral that is late, lost, altered, damaged or misdirected (whether or not after their receipt by doctoroo) due to any reason beyond the reasonable control of doctoroo; and</p>\r\n<p>ii. any variation in the promotion value to that stated in these terms and conditions.</p>', 'Terms & Conditions for \'Refer a friend\'', 'Terms & Conditions for \'Refer a friend\'', 'Terms & Conditions for \'Refer a friend\'', 'Active', '2017-06-13 06:31:32', '2017-06-29 08:50:11');
