INSERT INTO `dod_email_template` (`id`, `template_name`, `template_subject`, `template_from`, `template_from_mail`, `template_html`, `template_variables`, `deleted_at`, `created_at`, `updated_at`) VALUES
(6, 'Account Activation', 'VERIFY YOUR ACCOUNT', 'ADMIN', 'doctorOO@webwing.com', '<h2>Verify Your Email Address</h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;Hello<strong> ##USER_FNAME##, </strong></p>\r\n<div style=\"text-align: left;\"><br />Thank you&nbsp;&nbsp;for creating an account with&nbsp;&nbsp;##APP_NAME##.</div>\r\n<div style=\"text-align: left;\">&nbsp;</div>\r\n<div style=\"text-align: left;\">You are successfully register with us and now you have to complete our authentication process. You have to verify your account by clicking following activation button.</div>\r\n<div style=\"text-align: left;\">&nbsp;</div>\r\n<div style=\"text-align: left;\">&nbsp;</div>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<div style=\"text-align: center;\"><strong>Please click on below button to verify your account.</strong></div>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<div style=\"text-align: center;\">##ACTIVATION_URL##&nbsp;<br /><br /></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Thanks and Regards,<br />&nbsp;##APP_NAME##</div>', '##USER_FNAME##~##APP_NAME##~##ACTIVATION_URL##~##EMAIL##', NULL, '2016-05-15 07:42:14', '2017-06-29 09:57:59'),
(7, 'Forgot Password', 'FORGOT PASSWORD', 'ADMIN', 'doctorOO@webwing.com', '<p>Hello <strong>##FIRST_NAME##</strong> ,</p>\r\n<p>You forget your password, don\'t worry. Our system help you to reset your password easily.</p>\r\n<p>Following &nbsp;are the details of your account. You can now set your new password by just click on following button.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Account Details:</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 103px;\"><strong>Username</strong></td>\r\n<td style=\"width: 485px;\">##EMAIL##</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>Reset Your Password Just Click On Following Button</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">##REMINDER_URL##</p>\r\n<p style=\"text-align: left;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><br /><br />Thanks and Regards, &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <br />##SITE_URL## &nbsp;&nbsp;</p>', '##FIRST_NAME##~##EMAIL##~##REMINDER_URL##~##SITE_URL##', NULL, '2016-05-15 10:13:47', '2017-03-02 18:14:37'),
(38, 'Patient - Account verification Email Template', 'Welcome to doctoroo - we\'re launching soon!', 'doctoroo', 'wecare@doctoroo.com.au', '<p>Dear ##FIRST_NAME##,</p>\r\n<p><br />Welcome to doctoroo. We&rsquo;re excited that you, along with many others, have put your trust in us for your health needs.</p>\r\n<p>As you may have noticed, we are still under development and are working extremely hard to have our website and apps ready for you very soon.</p>\r\n<p>You&rsquo;ll soon be able to see a wide selection of experienced and caring doctors online, anytime, anywhere.</p>\r\n<p>Our platform will also allow you to:</p>\r\n<ul>\r\n<li>Obtain advice and treatment conveniently</li>\r\n<li>Get prescriptions, medical certificates &amp; referrals</li>\r\n<li>Set medication and repeat reminders</li>\r\n<li>Order your medications online &amp; have them delivered</li>\r\n<li>Click &amp; Collect your order from your pharmacy</li>\r\n<li>Invite your own doctor or pharmacy to the platform</li>\r\n</ul>\r\n<p>We are passionate about playing a part in improving your health through our innovative and convenient telemedicine platform that empowers you, and every Australian, to a healthier life without time, location or language barriers.</p>\r\n<p>You&rsquo;ll be among the first to be notified of when we launch. Although we hope you won&rsquo;t need us, just know that if you do &ndash; we&rsquo;ll be there 24/7 for you and your family.</p>\r\n<p>&nbsp;</p>\r\n<p><em>Warm</em><em>&nbsp;</em><em> regards,</em></p>\r\n<p>The doctoroo team</p>\r\n<p><br /><br /></p>', '####FIRST_NAME####~####ACTIVATION_LINK####~####APP_NAME####', NULL, '2017-02-22 12:31:25', '2017-06-09 18:51:58');
