(6, 'What is Doctor Timing or When  Patient can call Doctor', '9-7pm', 'Active', '2017-02-26 12:34:59', '2017-03-13 19:00:45'),
(7, 'What is the cost of doctor', 'From $28        ', 'Active', '2017-02-28 12:12:28', '2017-06-29 09:49:55'),
(8, 'What is doctoroo', 'Doctoroo is an online platform allowing Healthcare professionals to offer their services online - through video visits, digital prescriptions and connected pharmacy network.                 ', 'Active', '2017-02-28 14:58:19', '2017-09-20 08:36:00');
