(7, 'After hours home Doctor', 'after-hours-home-doctor', 'After hours home Doctor', 'GP\'s available 24/7, anywhere in Australia.', '24/7 Hour Home Doctor |  After Hours GP Helpline | Doctors Open Sunday', '24 7 doctor, 24 hour doctor, after hours doctor, after hours gp, after hours gp helpline, doctors open on Sunday, home doctor, doctor at home, house doctor, house call doctor, home doctor service, home visit doctor, national home doctor', 'AFTER HOURS HOME DOCTOR', 'Do you need an after hours GP help? Doctoroo offers online doctor 24/7 hour service. Doctors Open On Sunday providing you with the best care at home when you need it.', 'We’ve all been there..', 'Feeling sick, needing help from a doctor quickly, and realising that the doctor’s clinic is closed after hours or on a Sunday. Sometimes we’re just too busy to go during the day, and by the time we arrive home, there’s no time to go to the medical centre and get a check-up. At other times, the last thing we want to do whilst sick is travel and wait for hours at the doctor’s office to then only be seen for a few minutes.  ', 'Doctors available for you - when you need them most ', 'We no longer need to wait to get treated, while having sleepless nights until the doctors open the next day. Our GP\'s are available:\r\n<p>- 24 hours a day\r\n<p>- 7 days a week\r\n<p>- After hours every day (including weekends)\r\n<p>- 365 days a year\r\n', 'after-hours-home-doctor', 'after-hours-home-doctor', 'after-hours-home-doctor', 'How does doctoroo work? ', 'doctoroo is a telemedicine platform created by a Medical Scientist with advice from a selective team of doctors, pharmacists and health experts.\r\n<p>\r\nWe have a range of doctors on our platform who are qualified, experienced, insured, caring and speak a range of languages. \r\n<p>\r\nYou can sign up for free, choose a doctor, select a suitable time, pay & confirm your booking. You\'ll then receive a reminder 5 minutes before your consultation, after which the doctor will then call you via the app.  \r\n<br>', '', 'yes', 'Benefits of Telemedicine', 'With increasing number of Australians using telemedicine every year (MBS Online), there are many situations and people that would greatly benefit from Telemedicine, including: ', 'The benefits of seeing a doctor online for various common conditions is a convenience many Australians love. Our doctors are online when you need them most, to help you feel better, sooner. ', 'How much does it cost?', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our app. \r\nYou’ll only need to pay when you book a doctor.  \r\nAs one of Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.  \r\n', 'What can you do on doctoroo?', 'Besides being a 24 hour online medical centre and an after hours GP helpline for you to use anytime, your account allows you to: ', 'You may be asking yourself, how exactly can a doctor diagnose and treat me online? \r\n<p/>\r\nWhen we set out to make your healthcare easier, we knew that we could never replace a traditional, in-person consultation with Doctors, and we haven’t tried to. What we have done instead, is offer a complimentary service where you can use our platform for issues that don’t require physical examination.', 'How do I get started? ', 'Booking a doctor online takes just a few minutes and it\'s completely free to signup. Start feeling better sooner!\r\n', '2017-11-22 07:04:59', '2017-11-22 07:04:59'),
(8, 'Online Doctor Consultations', 'online-doctor-consultations', 'Online Doctor Consultations', 'With qualified, experienced and caring Australian doctors ', 'Book Online Doctors Appointment Australia | Online Doctor Consultation', 'book doctor online, doctor online australia, doctors online, online doctor, book online appointment, online doctor service, online doctor consultation', 'Online Doctor Consultations', 'Book doctor online consultation in just a single-click. Fix an appointment with specialist doctors and get an online doctor consultation at home. 24/7 hour doctor assistance.', 'Doctors available  Anytime, Anywhere ', 'By simply making an account, you can book an online doctor service in less than a minute using your phone or \r\ncomputer. Our doctors are available for you 24 hours a day, 365 days every year. Here’s a quick outline of how it works: \r\n<br>\r\n1. Make an Account \r\n<br>\r\n2. Search for a Doctor (by name, gender, language, time) \r\n<br>\r\n3. Confirm booking & pay \r\n<br>\r\n4. Await a call from your doctor \r\n<br>\r\n5. Receive advice, medical certificate, prescription or referrals right after the call\r\n<br>\r\n6. Pickup your medication from your local pharmacy, or have it delivered to you.', 'How are the online consultations conducted?', 'After making a booking, you’ll receive a notification 5 minutes before your doctor consultation time in order to prepare and be ready in a private sitting. Your doctor will then call you via the doctoroo app, and you’ll be able to see the doctor face-to-face and exchange messages and photos during the consultation. \r\n\r\nYour doctor will ask you questions to confirm your identity and to diagnose your symptoms. He’ll then give you appropriate online doctor service and advice followed by the treatment to help with your condition.\r\n', 'Doctors have wide-ranging experience', 'Choose a Doctor that speaks your language', 'Available 24 hours a day, every day of the year', 'What else can you do?', 'Besides having a consultation online, doctoroo also allows you to:\r\n<br>\r\n•	Get prescriptions for various medications\r\n<br>\r\n•	Get a medical certificate for work, school, university or sports\r\n<br>\r\n•	Click & collect your medications from your nearest pharmacy\r\n<br>\r\n•	Have your medications delivered to your home or office\r\n<br>\r\n•	Get Medical Exams, Pathology and Specialist Referrals\r\n<br>\r\n•	Invite your own doctor to the platform\r\n<br>\r\n•	Manage your medications, and easily reorder medications & repeats\r\n', '', 'no', '', '', '', '', '', '', '', '', '', '', '2017-11-22 08:27:21', '2017-11-22 08:27:21'),
(9, 'Online Doctors', 'online-doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', ' Online Doctors', ' Online Doctors', ' Online Doctors', 'Online Doctors', ' Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', 'Online Doctors', '', 'no', '', '', '', '', '', '', '', '', '', '', '2017-03-30 21:45:45', '2017-03-30 16:15:45'),
(10, 'Online Doctors Certificate', 'online-doctors-certificate', 'Online Doctors Certificate', 'Get a Medical Certificate easily and conveniently online', 'How to Get Online Medical Certificate | Online Doctor Service Australia', 'how to get a medical certificate, medical certificate, medical certificate australia, medical certificates online, online medical certificate online medical advice, online doctors australia, online doctor service', 'Online Medical Certificate ', 'Getting a medical certificate from an online doctor saves a lot of times. The online doctors at doctoroo  may be able to help. Get your medical certificate online now.', 'Convenient. Easy. Affordable. ', 'It’s ironic that when we’re sick, doctors tell us to \r\nrest in bed yet we would of needed to get out of bed to get \r\nthat advice. With doctoroo, that’s no longer the case, with medical certificates now easily obtainable \r\nonline using any device, anytime, anywhere you are in Australia.  ', 'How is it possible to get a medical certificate online? ', 'Our telemedicine platform was designed by a Medical Scientist to ensure that it was quick and easy to get your medical certificate when you need it most. It takes less than 60 seconds to book a doctor and most consultations take less than 5 minutes, where the doctor can actually diagnose you, offer treatment, and write up your medical certificate, which will be available for download right after your call\r\n\r\nWhat’s included in our sick notes? \r\n<br>\r\n- Doctors details \r\n<br>\r\n- Date of absence \r\n<br>\r\n- Reason for absence (if required) \r\n<br>\r\n- Recommendations about how and when you\'ll be able to return to your duties \r\n<br>\r\n- Whether you\'re able to return to your duties with amended responsibilities (e.g. no heavy \r\nlifting or reduced hours) \r\n<br>\r\n- Instructions on how your employer or institution can authenticate the validity of the sick note ', 'Online Doctors Certificate', 'Online Doctors Certificate', 'Online Doctors Certificate', 'Is the Medical Certificate Official? ', 'Of course! The Medicate Certificate sent to you follows the guidelines outlined by the Australian Medical Association (AMA). It’ll have all the doctor\'s details, the date of absence and the reason for absence (if required), as well as all other required details. \r\n<br>\r\nThe Medicate Certificate supplied to you meets all Australian Laws and Regulations, the requirements of the Fair Work Act and the guidelines set by the AMA. The Medical Certificate can easily be verified by contacting the appropriate doctor. \r\n<br>\r\nThe medical certificate will be available for you to download as a PDF in your doctoroo account, which you can then easily download and email to your company or institution. ', '', 'yes', 'What can you use the medical certificate for?', 'We understand that many organisations, companies and institutions require you to have a doctor’s certificate when you’re absent or know you’ll be absent. Our medical certificates can be used for all situations, including: ', 'Most other situations - as you would with a traditional certificate', 'How much does a medical certificate cost?', 'Although there is no set cost for a medical certificate, seeing a doctor online on our platform is the \r\nmost affordable in Australia. Most medical certificate consultations cost just $28.  \r\n', 'What conditions can I get a medical certificate for? ', 'Most conditions can be given a medical certificate for, although some may require an in-person doctor visit to get proper diagnosis and treatment. Some of the common conditions you can receive a medical certificate for include: ', '<b>Why do I need to a see a doctor to get my medical certificate?<b>\r\n<br>\r\nSometimes we may think we have a simple illness and misdiagnose it as the flu, a harmless headache or stomach ache and self-treat it. In order to avoid this, and for doctors to actually ask you questions about your condition in case its more serious than you had thought, to get a medical certificate you’ll need to see a doctor who can also offer you advice on how to get better soon and any treatment you need. Most medical certificate consultations take less than 5 minutes and can be done from anywhere. \r\n<br>\r\n<b>Can my employer, school, university or sports club check the validity?<b>\r\n<br>\r\nYour employer or institution can easily verify the details contained within your sick note, the time of consultation and the doctor who you had a consultation. This is done directly with us, which means you won\'t need to do anything else', 'How do I get started?', 'Getting started is easy and free. The future of your healthcare is in your hands - literally. ', '2017-11-22 10:20:03', '2017-11-22 10:20:03'),
(11, 'Online Doctor Prescriptions', 'online-doctor-prescriptions', 'Online Doctor Prescriptions', 'Australian Doctors who genuinely look after Us', 'Online Doctor Prescriptions | Doctor Consultation | City, Diet Doctor', 'online prescriptions, prescriptions online, online doctor consultation, City Doctors, Diet Doctor, prescriptions', 'Online Doctor Prescriptions', 'Get doctors prescription online without going anywhere. Register yourself at Doctoroo for city doctors and find your specialist for online prescriptions.', 'We ’ ve all been there ', 'Ever needed an online prescription and had to wait hours to be seen by a doctor? The hassle of travelling to a doctor has been a common cause of why Australians aren’t taking their medications – the traditional way to get online doctor prescriptions is just inefficient, impractical and simply outdated.\r\n<br/>\r\nWhen you begin to rely on Doctoroo, there’s no need to consult city doctors for a prescription. Having issues with regard to your diet? We provide you a qualified diet doctor who’ll help you get in shape.', 'The new way to get a prescription - online ', 'When we already know which online prescription we need, why should we waste hours of our time and go through the hassle of having to travel to the diet doctor for something that only takes a few minutes? That’s no longer the case with us, doctoroo – where you can now get your prescriptions online, anytime, anywhere in Australia.\r\n</br>\r\nAvoid traveling all the way to city doctors for much needed prescriptions when we’re here to help you at every step.', 'Online Doctor Prescriptions', 'Online Doctor Prescriptions', 'Online Doctor Prescriptions', 'It doesn ’ t stop there ', 'What’s the point of being able to get your prescriptions online, only\r\n the then need to travel to your \r\npharmacy to buy the medication? Doctoroo allows you to send in your online prescription to any \r\npharmacy in Australia, where they’ll prepare the order for you, and alert you once ready for pickup.  \r\nThe added benefit is being able to have your prescription medication (and ot\r\nher non-prescription \r\nmedication) delivered right to you \r\n–\r\n whether you\r\n’\r\nre at home, the office or anywhere in Australia, \r\nwe\r\n’\r\nll get the medication to you.  ', 'bb', 'yes', 'How is doctoroo ’ s  online prescription service different? ', 'Doctoroo has been built for you \r\n–\r\n to use whenever you need it, intuitively and quickly. To achieve \r\nthis, we\r\n’\r\nve created ways that you can better take care of your health. ', 'What can you get a prescription for? \r\n<br>\r\nMost S3 and S4 scheduled drugs can be prescribed on doctoroo, with docto\r\nrs usually offering  \r\nOf course, some drugs cannot be prescribed due to health concerns, abuse, ad\r\ndiction or other \r\nmedicolegal reasons, which is for the safety of all involved. For these cases, we\r\n encourage patients \r\nvisit an in-person GP for advice and treatment.  \r\nYou can also request to have a generic or original brand for your medication \r\norder, just as you would \r\nin a traditional pharmacy.  ', 'How much does it cost?', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you book a doctor.  \r\nThere\r\n’\r\ns no set fee for a single prescription, as doctors offer this as part of their c\r\nonsultation, which \r\nstart from just $28. We\r\n’\r\nre proud to say that our partnerships with doctors and industry partners \r\nmean we\r\n’\r\nre Australia\r\n’\r\ns most affordable way to see a doctor online. \r\nThe average consultation is around 7-8 minutes, costing just $38.  \r\n', 'What else can you do on doctoroo?', 'Besides being an online prescription service for us to use anytime, your acc\r\nount allows you to: ', 'Online Doctor Prescriptions', 'How do I get started?', 'Average calls lasts 6-8 minutes and cost just $24 - $36. All other app features are free for you', '2017-11-22 10:24:48', '2017-11-22 10:24:48'),
(12, 'See a Doctor at home', 'see-a-doctor-at-home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at Home', 'See a Doctor at Home', 'See a Doctor at home', 'See a Doctor at Home', 'See a Doctor at home', ' See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'See a Doctor at home', 'aa', 'no', '', '', '', '', '', '', '', '', '', '', '2017-09-20 11:11:46', '2017-09-20 11:11:46'),
(13, 'Talk to a Doctor online', 'talk-to-a-doctor-online', 'Talk to a Doctor online', 'Ready to give you the care and medical advice you need ', 'Talk to a Doctor Online |  See a Doctor Online Medical Advice service', 'talk to a doctor, talk to a doctor online, speak to doctor, medical advice, see a doctor', 'Talk to a Doctor online', 'Ask a doctor online and get online medical advice at Doctoroo. Talk to a doctor online without any hassle, anytime, anywhere. See a doctor 24/7 on your computer or mobile.', 'A doctor online, anytime, anywhere', 'Gone are the days of having to visit a doctor, wait hours until you’re seen for something that usually takes just a few minutes. doctoroo is a unique platform in Australia where you can talk to a doctor online, using any device. Getting online medical advice has never been easier, where you could talk to a doctor in just a few minutes and start feeling better today.', 'How do I speak to a doctor online?', 'In order to get online medical advice, you’ll first need to create a doctoroo account. To see a doctor online, setting it all up and booking a doctor is completely free and takes just a few minutes! \r\nHere’s how you can signup: \r\n<br>\r\n1. Make an Account \r\n<br>\r\n2. Search for a Doctor (by name, gender, language, time) \r\n<br>\r\n3. Confirm booking & pay \r\n<br>\r\n4. Await a call from your doctor \r\n<br>\r\n5. Receive advice, medical certificate, prescription or referrals right after the call\r\n<br>\r\n6. Pickup your medication from your local pharmacy, or have it delivered to you ', 'Free to Signup ', '5-20 years experienced doctors', 'Other languages', 'How  do I  get ready for the consultation? ', 'In order to get ready for the doctor to give you the best care, you’ll first need to be in a private space, where no one can disturb your consultation or listen in on the conversation with your doctor. Other ways to get ready for the best care online include: \r\n<br>\r\n1.Making sure you have good internet connection  \r\n<br>\r\n2.Your device has enough battery to last at least for the next 30 minutes\r\n<br>\r\n3.You have the doctoroo app installed on your phone and you’ve logged in \r\n<br>\r\n4.If using a computer, check your microphone and camera are connected and functioning properly \r\n<br>\r\n5.\r\nThere are no loud sounds around you that may interfere with your consultation ', 'aa', 'yes', 'About our doctors ?', 'A great number of Australian doctors have joined doctoroo from all over Australia, and provide online consultations to their patients and patients across the country. We know that your health is an important and private part of your live, and so we all want a doctor who can listen, understand and share their valuable advice with us. That’s why we’ve chosen doctors who are:', 'We have a wide selection of doctors to choose from, and if your GP is on doctoroo, you can even see them online. If they aren\'t yet on doctoroo, you can easily invite them to join!', 'How much does seeing a doctor online cost?', 'Although no one can put a price on a person\r\n’\r\ns health, it\r\n’\r\ns completely free to signup & use our app. \r\nYou\r\n’\r\nll only need to pay when you talk to a doctor online.  \r\nAs Australia\r\n’\r\ns most affordable way to see a doctor online, consultations start from just\r\n $28, with the \r\naverage consultation being around 7-8 minutes, costing just $38.  \r\n', 'What can I speak to the doctor about? ', 'When we set out to make seeing a doctor online easier for Australians, we knew that we could never replace a traditional, in-person consultation with our Doctors, and we haven’t tried to. What we have done instead, is offer a complimentary service where you can use our platform for issues that don’t require physical examination.  \r\n<br>\r\nConditions you see a doctor about online:', 'Being an online consultation, there are some conditions you can\'t and shouldn\'t see a doctor online for - including emergencies, poisoning, chest pains and many others. Please use your judgement and read our Terms before deciding to use doctoroo. We always recommend to see a GP in person, visit a hospital or dial 000 for any emergencies or if you are unsure about the severity of your condition. ', 'How do I see a doctor online?', 'Signing up is completely free and takes just a few minutes to book a doctor. Getting advice from a doctor couldn\'t have been any easier!', '2017-11-22 10:28:48', '2017-11-22 10:28:48'),
(17, 'Chat with a Doctor', 'chat-with-a-doctor', 'Chat with a Doctor', 'The future of healthcare is in your hands - literally.', 'Chat with Doctor | Depression Helpline Chat | Phone Doctor | Doctor App', 'doctor chat, doctor app, phone doctor, qoctor, depression helpline chat, Dr App', 'Chat with a Doctor on your phone ', 'Get doctor App & chat with a doctor online. Download Doctoroo\'s dr App for depression helpline chat for quick support. Chat one on one with a qualified doctor. Chat now!', 'The Future of Healthcare begins today ', 'Gone are the days of travelling to a Doctor and waiting hours to be seen for a few minutes. With doctoroo, it takes just a few minutes to book a doctor via our website or mobile app. After booking a doctor, you’ll get a call via the doctor app at the selected time where you can see the doctor via video and chat about your health condition, receive treatment, a medical certificate or prescription if needed.\r\n</br>\r\nNeed someone qualified enough to tackle your health problem? We at doctoroo will serve you with the licensed phone doctor. We understand that people don’t have time to see a doctor, so we provide them with user-friendly Dr App. ', 'How does it work?', 'By simply making an account, you can book a chat doctor in less than a minute using your phone or computer. Our depression helpline chat for you 24 hours a day, 365 days every year. Here’s a quick outline of how it works: \r\n<br>\r\n1. Make an Account on a chat doctor app\r\n<br>\r\n2. Search for a Doctor (by name, gender, language, time) on Dr App\r\n<br>\r\n3. Confirm booking & pay \r\n<br>\r\n4. Await a call from your phone doctor \r\n<br>\r\n5. Receive advice, medical certificate, prescription or referrals right after the call\r\n<br>\r\n6. Pickup your medication from your local pharmacy, or have it delivered to you ', '', '', '', 'Who is doctoroo made for?', 'Practically everyone! Our platform was designed for all ages, all educational backgrounds and computer knowledge skills. We’ve made it simple and fast as possible to see a doctor. Some of our users include Australians who have difficulty travelling or arranging travel, are simply too busy or time-poor. ', '', 'yes', 'About our doctors', 'Some of Australia’s best doctors have joined doctoroo from all over Australia, and provide online consultations to their patients and patients across the country. We know that your health is a private topic and so we all want a doctor who can listen, understand and share their valuable advice with us. That’s why we’ve chosen doctors who are: ', 'You\'ll be able to book your own family GP - if they\'re not yet on doctoroo, you can even invite them too!', 'How much does it cost?', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our app. You’ll only need to pay when you book a doctor.  As Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.  \r\n', 'What conditions can I see the doctor for?', 'More than you’d think! Some of the most common conditions you can be treated for include: ', 'You may also see the doctor or message the doctor for a quick chat or you could use it as a depression helpline when you need a doctor to talk to, wherever you are. Of course, some conditions cannot and should not be treated online, especially life-threatening emergency situations, in which case you should dial 000 immediately. ', 'How do I get started? ', 'Taking care of your health doesn’t need to be complicated, and with doctoroo it couldn\'t be any easier! Sign up for free and start feeling better, sooner. ', '2017-11-22 10:30:42', '2017-11-22 10:30:42'),
(18, 'ONLINE DOCTORS AUSTRALIA', 'online-doctors-australia', '', 'Book a doctor’s appointment today and have your consultation conveniently online ', 'Online Doctors Australia, Online Doctor Australia', 'Online Doctors Australia, Online Doctor Australia, Doctor Online Australia', 'ONLINE DOCTORS AUSTRALIA ', 'Find a doctor online in Australia at Doctoroo, contact for quick consultation, prescription order and a referral request in the most convenient way.', 'How can I book a Doctor online? ', 'Booking a doctor online on doctoroo takes just a few minutes, and all you’ll need to do is: \r\n<br>\r\n1.Make an account \r\n<br>\r\n2.Select your suitable day & time \r\n<br>\r\n3.Select your doctor \r\n<br>\r\n4.Confirm & pay for consultation \r\n<br>\r\nAll this will take you just a few minutes and you can make a booking on any device, anytime, anywhere in Australia.  ', 'How are the online consultations conducted?', 'After making a booking, you’ll receive a notification 5 minutes before your consultation time in order to prepare and be ready in a private sitting. Your doctor will then call you via the doctoroo app or site, and you’ll be able to see the doctor face-to-face and exchange messages and photos during the consultation.  \r\nYour doctor will ask you questions to confirm your identity and to diagnose your symptoms. He’ll then give you appropriate advice and treatment to help with your condition.  ', '', '', '', 'What else can you do?', 'Besides having a consultation online, doctoroo also allows you to: \r\n<br>\r\n1.Get prescriptions for various medications \r\n<br>\r\n2.Get a medical certificate for work, school, university or sports \r\n<br>\r\n3.Click & collect your medications from your nearest pharmacy \r\n<br>\r\n4.Have your medications delivered to your home or office \r\n<br>\r\n5.Get Medical Exams, Pathology and Specialist Referrals \r\n<br>\r\n6.Invite your own Doctor to the platform \r\n<br>\r\n7.Manage your medications, and easily reorder medications & repeats ', '', 'yes', 'What can I see the doctor for?', 'Our online consultation service allows you to see the doctor for a range of conditions. Some of these include: ', 'Obviously, being an online consultation, there are limitations as to what the doctor can diagnose and treat you for. We highly recommend that you always visit the next available GP in person or call 000 for emergencies for any of these conditions.  ', 'How much does it cost? ', 'Although no one can put a price on a person’s health, it’s completely free to signup & use doctoroo. You’ll only need to pay when you book a doctor. As Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.  \r\n', 'Why doctoroo?', 'Some of the benefits of doctoroo include:', '.', 'How do I get started?', 'We know you\'ll love the convenience and simplicity of doctoroo. It takes just a few minutes and it\'s completely free to sign up and book a doctor. It\'s the better way to feel better!', '2017-09-20 09:39:36', '2017-09-20 09:39:36'),
(20, 'Dial a Doctor on demand', 'dial-a-doctor-on-demand', '', 'Dial a doctor anytime, using any device', 'Dial a Doctor | Doctors Available on Demand  | Doctors on Call', 'dial a doctor, dial a dr, call a doctor, doctors on demand, doctor on call, 24/7 hours, doctroo', 'Doctors available on demand', 'Doctor On Demand is the fastest way to see an urgent care doctors on your device. Connect to a doctor on call for healthcare assistance. Dial a doctor anywhere and anytime.', 'The old, inefficient way', 'When sick, in pain or needing to call a doctor for a check-up, we often find ourselves traveling to the doctor, waiting for hours, to then only see the doctor for a few short minutes. It does not even take less than 60 seconds when you dial a dr. Being at the doctors’ clinic may have actually made us more sick. Because it’s often a common place for people to transfer the flu and other infections. That was the inefficient and old way.', 'The future of your health is in the palm of your hands - literally  ', 'The new way is using your phone to dial a doctor, who will then give you a call at your booking time. It’s a very simple process to call a doctor. doctoroo is like having a doctor on call, available for you on demand wherever you go. You’ll be able to dial a doctor of your choice – you can search doctors by name, gender, availability and even languages spoken. \r\n</br>\r\nYou get to save your valuable time when dial a doctor. Seeing a doctor has never been easier. ', '', '', '', 'How does it work?', 'Our online Doctor service is very simple to use for all patients – simply sign up for free and book a doctor. You’ll then receive a call from your Doctor, right on your appointment time, where you can see them face-to-face via your device camera. They’ll conduct their consultations as they would for in-person patients, asking you the standard questions and diagnosing you and offering appropriate treatment if necessary.  \r\n<p/>\r\nWhen we would previously dial a Doctor to book an appointment, then travel to them, wait in the clinic and then go to the pharmacy to pick up our medications – we can now do all that from the comfort and convenience of our homes, office or anywhere in Australia. Simply put, if you can access Facebook or Google on your device, you can now access a Doctor through doctoroo.  ', '', 'yes', 'What else can you do?', 'Having a GP on call isn’t the only exciting feature of doctoroo, your account allows you to: ', 'We hope to help those Australian\'s who can benefit from and need the healthcare system the most, and our mission is to continue to bring you the best solutions to the biggest health problems. ', 'How much does it cost? ', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our app. You’ll only need to pay when you book an online GP. As Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38. ', 'Benefits of Doctoroo', 'We’re serious about healthcare and about the health of Australians. That’s why we’ve made sure doctoroo actually helps you. Telehealth platforms have been studied, and shown to be beneficial in many ways. Some of the reasons why doctoroo is beneficial include:', 'And that\'s not all. We\'re working to solve the biggest set backs in Australian healthcare, so that we can all live healthier, more convenient lives. ', 'How do I get started?', 'Getting started is easy and free. Click the button below to make an account and see a doctor today! ', '2017-11-22 07:18:45', '2017-11-22 07:18:45'),
(21, 'Book a Doctor Online in Australia', 'book-a-doctor-online-in-australia', '', 'Book a GP online, anytime, anywhere.', 'Book Doctor Online, Online Doctor Appointment, 24 hour Medical Centre', 'book doctor online, online doctor appointment, 24 hour medical centre', 'Book an Australian Doctor online', 'Book an online doctor appointment to get in touch with 24 hour medical centre that can listen, understand and provide you online assistance for health related services.', 'Book a doctor online, wherever you are in Australia', 'After a scheduled online doctor appointment for your medical need? No matter wherever you’re in Australia, booking a doctor online was never so easy. With doctoroo - Australia’s best and unique platform to book a doctor online, we have made things much easier for you. That’s not all! You can even manage your medications. \r\n<br>\r\nWe have a range of experienced and qualified doctors who genuinely care about treating you, speak multiple languages and are available throughout the day. We’ve truly created a platform that our users love and is available for you when you need it most!', 'See a doctor online, anytime, anywhere', 'Booking an online doctor appoinment takes less than 60 seconds. Moreover, you don’t need to wait for the right time to do so, as it can be done anytime using any device. It’s completely free to book a doctor online. In many instances, you’ll be seeing your doctor within minutes, getting diagnosed, receiving treatment and feeling better sooner.', '', '', '', 'Who can see a doctor online?', 'Literally anyone in Australia who has access to a phone, laptop or tablet with a camera, microphone and internet connection (these days, that’s virtually our whole population).  \r\ndoctoroo was built to make doctor\'s easily accessible and affordable for Australian\'s who don’t have the time to travel to a doctor, wait for hours and then travel to the pharmacy, for something they could\'ve easily done in a few minutes from their phones at home or the office. doctoroo also makes it easy for any Australians who: \r\n<br>\r\n- Live in remote areas  \r\n<br>\r\n- Are housebound  \r\n<br>\r\n- Have difficulty travailing  \r\n<br>\r\n- Have trouble lining up childcare  \r\n<br>\r\n- Just don\'t have the time to make it to a doctor or pharmacy  ', '', 'yes', 'What can you do on doctoroo?', 'Besides being a 24 hour online medical centre and an after hours GP helpline for you to use anytime, your account allows you to: Besides being a 24 hour online medical centre and an after hours GP helpline for you to use anytime, doctoroo allows you to: ', 'Part of the reasons why doctoroo is popular is due to the convenience, time and money it saves Australians. Our aim is to continue to bring the best solutions to the biggest problems with current healthcare for all of us to use. ', 'How much does it cost?', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our app. You’ll only need to pay when you book a doctor.  As Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.  \r\n', 'About our doctors', 'We know that your health is a private topic and so we all want a doctor who can listen, understand and share their valuable advice with us. That’s why we’ve chosen doctors who are: ', 'You’ll be able to see your doctors profile before you book them and invite see your own GP. If they\'re not yet on doctoroo, you can easily invite them too!', 'How do i book a doctor?', 'Booking a doctor online takes just a few minutes and is completely free. Sign up for free and start feeling better sooner. ', '2017-10-03 12:38:47', '2017-10-03 12:38:47'),
(23, 'See a GP online', 'see-a-gp-online', '', 'Australian doctors ready to care for you - when you need them most', 'Online GP, GP on Call, GP Helpline, GP Online Services', 'gp to you, gp2u, gp helpline, online gp, gp online, gp service', 'See a GP online', 'Get GP on call at Doctoroo! Yes, no need to worry. Now, consult with online GP to You with Doctoroo\'s helpline. 24*7, Sunday open. Book GP online now!', 'Online GP’s available anytime ', 'Have you ever wondered why doctors (available after hours) are so difficult to get a hold of and take a while to actually see you? We have too! In fact, it was the whole reason why doctoroo was started – to give better healthcare access to Australians all over the country, whenever they need it most. It’s time you get treated by a qualified GP on call to regain your health.\r\n<br>\r\ndoctoroo - a leading and unique healthcare platform bridges the gap between patients and doctors. It can be used as an effective GP helpline to access quality healthcare services.', 'How does doctoroo benefit me? ', 'Besides booking a doctor through the app and seeing an online GP, doctoroo allows you to: \r\n<br>\r\n1.\r\nSpeak with a doctor on any device \r\n<br>\r\n2.\r\nGP helpline available 24/7\r\n<br>\r\n3.\r\nGet medical advice, diagnosis and treatment \r\n<br>\r\n4.\r\nGet prescriptions straight to your phone \r\n<br>\r\n5.\r\nGet repeat prescriptions for your medications \r\n<br>\r\n6.Get a GP on call for immediate healthcare assistance\r\n<br>\r\n7.\r\nOrder any medication from any pharmacy across Australia \r\n<br>\r\n8.\r\nManage, get reminded and reorder your medications and repeats \r\n<br>\r\n9.\r\nHave your medications delivered to you \r\n<br>\r\n10.\r\nClick & collect medications from your nearest pharmacy.', '', '', '', 'Who are the doctors?', 'All Doctors on our platform are selected based on very high standards. We ensure that all Doctors on our platform are accredited and registered by AHPRA, and have full indemnity insurance. Many of them have between 5 – 20+ years of experience and some even speak other languages too! ', '', 'yes', 'Is doctoroo for me? ', 'doctoroo was built to make doctors easily accessible and affordable for Australian\'s who don’t have the time to travel to a doctor, wait for hours and then travel to the pharmacy, for something they could have easily done in a few minutes from their phones at home or the office.  doctoroo also makes it easy for any Australians who:', 'We hope to help those Australian\'s who can benefit from and need the healthcare system the most, and our mission is to continue to bring you the best solutions to the biggest health problems. ', 'How much does it cost?', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our app. You’ll only need to pay when you book an online GP.  As Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.  \r\n', 'How exactly can a doctor diagnose and treat me online', 'When we set out to make healthcare easier for Australians, we knew that we could never replace a traditional, in-person consultation with our Doctors, and we haven’t tried to. What we have done instead, is offer a complimentary online service where you can use our platform for issues that don’t require physical examination. Conditions the doctor can treat me for include:', 'Conditions the doctor can’t treat me for Emergencies, Toxic/Poisonous Reactions, Serious Pain,  Heavy Chest Pain or Tightness and others. Always see the next available GP in person, visit the hospital or call 000 for emergencies.', 'How do I see a GP online?', 'Seeing a GP online can be done easily, by booking your consultation in just a few minutes. All it takes is one click to start feeling better. ', '2017-11-22 10:26:47', '2017-11-22 10:26:47'),
(24, 'Home Doctor service, online', 'home-doctor-service-online', '', 'The new way of a Doctor visiting your home, nationally.', 'Home Doctor, Doctor at Home, Home Doctor Service, Home Visit Doctor, House Doctor', 'Home Doctor, Doctor at Home, Home Doctor Service, Home Visit Doctor', 'Home Doctor Service Online ', 'Looking for home doctor service? Register at Doctoroo and get doctor visit at home in Australia. Book Now!', 'The traditional house call doctor service', 'The only traditional way to seek consultation from a doctor was to visit the doctor. Waiting at the clinic was a time-consuming process. This was then evolved into a home doctor service – where you were able to call a house doctor to travel to your place. Although this may be a good option for some situations, three main issues were noted by many users: \r\n<br>\r\n1) Long waiting times involved for the home visit doctor, where a few doctors would be servicing a large area \r\n<br>\r\n2) Due to the large country we have, it’s almost impossible to be able to reach all users, as some towns and cities are tens of hours away of driving\r\n<br>\r\n3) Due to restrictions by the government, all these home doctor services aren’t available during working hours, which means users still need to travel to the doctor until the home doctor service opened or have to delay the doctor visit until after hours – and when we’re feeling sick, waiting is the last thing we all want to be doing. \r\n<br>\r\nWhy not call a doctor at home and get the needed care and treatment?', 'The new way to see a doctor at home ', 'doctoroo was built to address not only the above limitations, but many other issues and inefficiencies in our healthcare system which are unfortunately all too common for many Australians. The new, exciting way to consult a home visit doctor on doctoroo is so straightforward, you’ll be wondering why it wasn’t made any sooner! Here how it works: \r\n<br>\r\n1. Make an Account \r\n<br>\r\n2. Search for a Doctor (by name, gender, language, time) \r\n<br>\r\n3. Confirm booking & pay \r\n<br>\r\n4. Await a call from your house doctor \r\n<br>\r\n5. Receive advice, medical certificate, prescription or referrals right after the call\r\n', '', '', '', 'What else can you do on doctoroo?', 'Besides being an online national home doctor service for you to use anytime, your account allows you to: \r\n<br>\r\n- Speak with a doctor on any device, from home or the office \r\n<br>\r\n- Doctors available 24/7 \r\n<br>\r\n- Get medical advice, diagnosis and treatment \r\n<br>\r\n- Get prescriptions that you can download after the video visit \r\n<br>\r\n- Get repeat prescriptions for your medications \r\n<br>\r\n- Order any medication from any pharmacy across Australia \r\n<br>\r\n- Manage, get reminded and reorder your medications and repeats \r\n<br>\r\n- Have your medications delivered to you \r\n<br>\r\n- Click & collect medications from your nearest pharmacy \r\n<br>\r\n- Have your consultation summary sent to your normal family GP  \r\n<br>\r\n- Save your medical history for future use ', '', 'yes', 'About our doctors ', 'We know that your health is a private topic and so we all want a doctor who can listen, understand and share their valuable advice with us. That’s why we’ve chosen doctors who are: ', 'You’ll be able to see your doctors profile before you book them, and can even search for your own GP - if they\'re not already with us, you can even invite them too!', 'How much does it cost? ', 'Although no one can put a price on a person’s health, it’s completely free to signup & use our app. The only time payment is involved is either when you\'re having a doctor consultation or if placing a medication order with the pharmacy.  \r\n<p>\r\nAs one of Australia’s most affordable way to see a doctor online, consultations start from just $28, with the average consultation being around 7-8 minutes, costing just $38.  \r\n', 'How secure are my consultations and private information? ', '<b/>\r\nWe recognize that security is an essential consideration and that’s why we’ve fully reviewed and \r\naddressed security concerns with your safety as the first priority. Our security policy has been a \r\nsimple one – to build a system that we’d trust our own personal data to be stored on. \r\n<b/>\r\nSome of the measures we take to ensure your privacy and security of your data include: ', '<br/>\r\nIs doctoroo national?\r\n<br/>\r\nThe great part about the internet is its accessible form almost anywhere in the world. This means that as long as you can access Facebook or Google, you can now see a doctor anywhere in Australia! Whether yo ’re in Sydney, Melbourne, Brisbane, Perth, Adelaide, Darwin, Hobart, Canberra or any place in between with an internet connection, you can easily book and see a doctor online. ', 'How do I get started?', 'We know you\'ll love the convenience and simplicity of doctoroo. It takes just a few minutes, and it\'s completely free to sign up and book a doctor. ', '2017-10-27 07:23:25', '2017-10-27 07:23:25'),
(26, 'Get a Sick Note & Doctor\'s Certificate', 'get-a-sick-note-&-doctor-certificate', '', 'Official Certificates delivered to you online, anytime, anywhere. ', 'Doctors Note, Sick Note | Sick Certificate, Doctor Certificate', 'doctors note, sick note, sick certificate, doctor certificate', 'Get a Sick Note & Doctor\'s Certificate ', 'Get a sick note, doctor note, sick certificate and doctor certificate online using your computer, tablet, or phone. anytime & anywhere you are in Australia.', 'Convenient. Easy. Affordable. ', 'It’s ironic that when we’re sick, doctors tell us to rest in bed yet we had to get out of bed to get that advice. With doctoroo, that’s no longer the case, with a doctors’ note now easily obtainable online using any device, anytime, anywhere you are in Australia.', 'How is it possible to get a doctor’s note online? ', 'Our unique and effective platform was designed by a Medical Scientist to ensure that it was quick and easy to get your doctors certificate when you need it most. It takes less than 60 seconds to book a doctor and most consultations take less than 5 minutes, where the doctor can also diagnose you, offer treatment, and write up your doctors certificate, which will be available for download right after your call. \r\nWhat’s included in our sick note? \r\n<br/>\r\n- Doctors details \r\n<br/>\r\n- Date of absence \r\n<br/>\r\n- Reason for absence (if required) \r\n<br/>\r\n- Recommendations about how and when you\'ll be able to return to your duties \r\n<br/>\r\n- Whether you\'re able to return to your duties with amended responsibilities (e.g. no heavy \r\nlifting or reduced hours) \r\n<br/>\r\n- Instructions on how your employer or institution can authenticate the validity of the sick note \r\n<br/>\r\nGetting a doctors note from a professionally qualified doctor will allow you to obtain a sick leave from the employer for your health condition.', '', '', '', 'Is the Doctors sick certificate official? ', 'Of course! The sick certificate sent to you follows the guidelines outlined by the AMA (Australian Medical Association). It’ll have all the doctors’ details, the date of absence and the reason for absence, as well as all other required details. The doctor’s note supplied to you meets all Australian Laws and Regulations, the requirements of the Fair Work Act and the guidelines set by the AMA. The sick certificate can easily be verified by contacting the appropriate Doctor. The doctors certificate will be available for download as a PDF in your doctoroo account, which you can then easily download and email to your company or institution. ', '', 'yes', 'What can you use the doctors certificate for?', 'We understand that many organisations, companies and institutions require you to have a Doctor’s Certificate when you’re absent or know you’ll be absent. Our doctor’s certificates can be used for all situations, including: ', 'you will be able to see  your doctor ', 'How much does a doctor’s certificate cost? ', 'Although there is no set cost for a doctor’s note, seeing a doctor online on our platform is the most affordable in Australia. Most doctors certificate consultations cost just $28.  \r\n', 'What conditions can I get a doctor’s certificate for? ', 'Most conditions can be given a doctor’s certificate for, although some may require an in-person doctor visit to get proper diagnosis and treatment. Some of the common conditions you can receive a doctor’s certificate for include: ', 'Why do I need to a see a doctor to get my doctors certificate? \r\n<b/>\r\nSometimes we may think we have a simple illness and misdiagnose it as the flu, a harmless headache or stomach ache and self-treat it. In order to avoid this, and for doctors to actually ask you questions about your condition in case its more serious than you had thought, to get a doctors certificate you’ll need to see a doctor who can also offer you advice on how to get better soon and any treatment you need. Most doctors certificate consultations take less than 5 minutes and can be done from anywhere. \r\n<b/>\r\nCan my employer, school, university or sports club check the validity?\r\n<b/>\r\nYour employer or institution can easily verify the details contained within your sick note, the time of consultation and the doctor who you had a consultation. This is done directly with us, which means you won\'t need to do anything else. ', 'How do I get started?', 'Get a Medical Certificate easily, by booking your consultation in just a few minutes. All it takes is one click to start feeling better. ', '2017-11-22 10:22:54', '2017-11-22 10:22:54');
